class SearchBar extends Component {
  render() {
    return (
      <div className="search-bar">
        <input
          name="searchTerm"
          type="text"
          placeholder="search..."
          onChange={() => this.props.handleChange()}
        />
        <button>search</button>
      </div>
    );
  }
}

export default SearchBar;
